@-moz-document domain("discord.com") {
/* Увеличиваем специфичность селекторов */
  body, body * {
    background-color: #1c1c1c !important; /* цвет фона, как ночное небо */
    color: #f0f0f0 !important; /* цвет текста */
  }

  /* Шапка сайта */
  .header, .header * {
    background-color: #2c2c2c !important; /* темнее для выделения */
  }

  /* Меню навигации */
  .nav-menu, .nav-menu * {
    background-color: #2c2c2c !important; /* темнее для выделения */
  }

  /* Контент страницы */
  .content, .content * {
    background-color: #1c1c1c !important; /* цвет фона, как ночное небо */
  }

  /* Футер сайта */
  .footer, .footer * {
    background-color: #2c2c2c !important; /* темнее для выделения */
  }

  /* Кнопки */
  button, button * {
    background-color: #4c4c4c !important; /* темные кнопки */
    color: #f0f0f0 !important; /* цвет текста кнопок */
  }

  /* Ссылки */
  a, a * {
    color: #8080ff !important; /* цвет ссылок, напоминающий звезды */
  }
}
